//2. Caculation interest

pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;
contract Ref {
    //Require call one contract////////////////
    address public owner;
    address public ownercontract;
    constructor() public {owner = msg.sender;}
    function setcontract(address contractuse) public{
        require(msg.sender ==owner, "You not owner");
        ownercontract =contractuse;
    }
    struct Listf{
        address sponsor;
        address f1;
    }
    Listf[] public listf;
    mapping(address => bool) public hasRefuse;   
    mapping(address => bool) public hasSponsor;
    mapping(address => address) public addresssponsor; // Get address sponsor
    // mapping(address => address) public addressf1;   // Get address f1
    mapping(address => uint) public balanceaccount; // Ref account 70%
    mapping(address => uint) public balanceaccount30; 
    mapping(address => uint) public totalsales;
    function getHasrefuse(address _address) external view returns(bool) {return hasRefuse[_address];}
    function getBalancewithdraw(address _address) external view returns(uint) {return balanceaccount[_address];}
    function getBalancewithdraw30(address _address) external view returns(uint) {return balanceaccount30[_address];}
    function getTotalsales(address _address) external view returns(uint) {return totalsales[_address];}
    function getListf() public view returns(Listf[] memory){return listf;}
    function createref(address user) public{
        require(msg.sender==ownercontract, "You not owner");
        if(!hasRefuse[user]){
            hasRefuse[user] = true;
            //transfer sponsor == me if can not sponsor
            // addresssponsor[user]= sponsor;
            // addressf1[sponsor] = user;
            // listf.push(Listf(sponsor ,user));
        }      
    }
    function setsponsor(address user, address sponsor) public {
        require(msg.sender==ownercontract, "You not owner");
        if(!hasSponsor[user]){
            addresssponsor[user]= sponsor;
            listf.push(Listf(sponsor ,user));
            hasSponsor[user]=true;
        }
    }
    function caculationInterest(address user, uint amount) public{
        require(msg.sender==ownercontract, "You not owner");
        uint[10] memory arrayInterest = [uint(5),4,3,2,1,1,1,1,1,1];
        address addressuse = user;
        for(uint i =0; i<10; i++){
            address sponsor = addresssponsor[addressuse];
            if(sponsor == 0x0000000000000000000000000000000000000000){
                sponsor = owner;
            }
                balanceaccount[sponsor] += 7 * arrayInterest[i] * amount /1000; // 70%
                balanceaccount30[sponsor] += 3 * arrayInterest[i] * amount /1000; // 30%
                addressuse = sponsor;
        }
    }

    function resetBalance(address account) public{
         require(msg.sender==ownercontract, "You not owner");
        balanceaccount[account]=0;
    }
    function resetBalance30(address account) public{
         require(msg.sender==ownercontract, "You not owner");
        balanceaccount30[account]=0;
    }

    function sales(address user, uint amount) public {
        require(msg.sender==ownercontract, "You not owner");
        address addressuser = user;
        for(uint i =0; i< 10000; i++){
            address sponsor = addresssponsor[addressuser];
            if(sponsor != 0x0000000000000000000000000000000000000000){
                totalsales[sponsor] = amount;
            }else{
                i=10000;
            }
            addressuser = sponsor;
        }
    }
}
